import React, {useEffect,useState} from 'react'

function Service() {

    const [yoga, setYoga] = useState([])
    console.log(yoga)

    useEffect(() =>{
        fetch('./yoga.JSON')
        .then(res=> res.json())
        .then(data=> setYoga(data))
    },[])
    return (
        <div>
            <h1>Hello</h1>
            {
                yoga && yoga.map((item)=>(
                    <>
                    <p>{item.name}</p>
                    {item.img}
                    </>
                ))
            }
        </div>
    )
}

export default Service
